import React from "react";
import Nike from "../../img/Nike"
export const Header = () => {
    return(
        <header>
            <div classname="menu">
                <box-icon name="menu"></box-icon>
            </div>
            <a href="#">
                <div className="logo">
                    <img src ={Nike} alt=""/>                
                </div>
            </a>
        </header>
    )
}
